use tonlib::cell::BagOfCells;


const BOC_MANY_CELLS: &'static str = "";


#[test]
fn large_nft_content_cell() {
    let boc = BagOfCells::parse_base64(BOC_MANY_CELLS).expect("NFT content cell is valid");
    let cell = boc.single_root().expect("NFT content cell has one root");
    let hash = cell.cell_hash_base64().expect("hashing failed");
    assert_eq!(hash, "aRUpVJUEl52zpLcXE421j/t9KiVOvzg/t2na/eoafKk=",
        "invalid hash; was cell deserialized correctly?");
    
    let data = base64::encode(boc.serialize(false).expect("serialization should succeed"));
    let reparsed = BagOfCells::parse_base64(&data).expect("reparsing should succeed");
    let other_cell = reparsed.single_root().expect("reparsing shouldn't have added roots");
    assert_eq!(other_cell.cell_hash_base64().expect("hashing failed"), hash);
}


